A Walk to Beautiful

Sociopolitical Documentary with no narration published by PBS broadcasted as part of PBS Nova series in 2008 - English language


Information
------------------------------

In this award-winning documentary, a difficult journey that begins in hopelessness and shame for thousands of women in Ethiopia ends in a productive new life. The film tells the personal stories of rural women who make their way to Ethiopia's capital, Addis Ababa, seeking treatment for obstetric fistula, a life-shattering complication of childbirth. Filmed in a starkly beautiful landscape, the documentary juxtaposes the isolated lives of village women who are outcasts because of their medical condition, with the faraway hospital that offers a miracle after a long and arduous trek-a &quot;walk to beautiful.&quot;

